// This is the footer component. 

import React from 'react';

function Footer() {
  return (
    <footer>
      <p>&copy; 2024 Your Blog. All rights reserved.</p>
      <p>
        <a href="mailto:contact@yourblog.com">contact@yourblog.com</a>
      </p>
    </footer>
  );
}

export default Footer;
